import PrimaryButton from '../Components/PrimaryButton';

class Home extends Component {
    render() {
        return (
            <>
            <Header />
                <div className='content-container'>
                    <h1 className='h2'>main header</h1>
                    <p>paragraph</p>
                    <PrimaryButton
                    text="Crews"
                    />
                    <PrimaryButton
                    text="My Club"
                    />
                </div>
                <Footer />
            </>
        );
    }
}

export default Home;
